import Link from 'next/link';

export default function Index() {
  return (

      <div className="container">

        <p id="about">ABOUT</p>
        <div>
          <h1>Code <br /> Blue </h1>
        </div>
        <div>
          <Link href="/menu">
            <a>ENTER</a>
          </Link>
        </div>

      <style jsx global>{`

        * { padding: 0; margin: 0 auto; box-sizing: border-box; }

        .container {
          overflow: hidden;
          top: 0;
          right: 0;
          background: rgba(251, 202, 43, 1);
          display: block;
          width: 100vw;
          height: 100vh;
        }

        #about {
          float: right;
          padding: 25px;
          fontFamily: Montserrat;
          fontSize: 100%;
        }

        h1 { 
          fontFamily: Raleway; 
          fontSize: 800%;
          float: left;
          textAlign: left;
          paddingTop: 10vh;
          marginLeft: 10vw;
          height: 80%;
          paddingBottom: 5vh;
        }

        a { 
          font-family: Montserrat; 
          font-size: 300%; 
          text-decoration: none;
          float: left;
          text-align: left;
          margin-left: 10vw;
          width: 80vw;
        }      
      `}</style>

    </div>
  );
}
